import React, { useEffect, useState } from 'react';
import SideMenu from '../FRONT/SECONPAGE/SideMenu'
import "../FRONT/SECONPAGE/SecondPage.css"
import Menubox from './Menubox';

function Menu() {
const [data,setData]=useState([]);

const  getdata=()=>{
    fetch("https://www.themealdb.com/api/json/v1/1/search.php?s").
    then((resp)=>resp.json()).
    then((datagroups)=>{
      const datagroup=datagroups
     

    }).catch("error")
}

useEffect(()=>{
  getdata()
},[])
const NewData=datagroup.meals.map((data)=>{
  return(
   <Menubox 
    Name={data.strMeal} 
    Area={data.strArea} 
    id={data.idMeal}  
    Type={data.strTags}
    img={data.strMealThumb}/>
  )
})

  return(
    <div className='menu'>
      <SideMenu className="sidemenu"/>
      {NewData}
      <div></div>
    </div>)
 
}

export default Menu;
